import ProtectedHeader from "../ProtectedHeader/ProtectedHeader";
import"./Movies.css";
import icon from "../../images/findIcon.svg";

function Movies() {
    return (
    <div class="movies">
      <ProtectedHeader />
      <form className="movies__search-form">
        <input placeholder="Фильм" type="search" className="movies__input">
          <button type="submit" className="movies__search-icon"><img src={icon} alt="search"/></button>
        </input>
        
      </form>
    </div>
    );
  }
  
  export default Movies;
